import * as types from '../../../constants/action-types'

export function getUserItems() {
  return {
    type: types.GET_USER_ITEMS,
  }
}

export function setUserItems(userItems) {
  return {
    type: types.SET_USER_ITEMS,
    userItems,
  }
}
